  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Pablo
  National Wildlife Refuge outlines Refuge accomplishments during the 1967 calendar
  year. The report begins by summarizing the weather conditions, water conditions,
  habitat conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
  fish, and reptiles- is also covered. The Refuge development and maintenance section
  discusses physical developments, vegetation control, and wildfires. Resource management
  is outlined; topics include grazing and fur harvest. A progress report on field
  investigations and applied research is also provided. The public relations section
  of the report describes recreational uses, hunting, and violations. Items of interest,
  N-R forms, and photographs are attached.\",\n\t\"license_title\": \"License Not
